Relationship.create([subject_id: (Resource.find_by literal: 'T0005672').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "تطبيق محدد للأساليب الرياضية والاحصائية لقياس تجريبي للعلاقات الاقتصادية وتحقيق للنظريات الاقتصادية, عادة بهدف توقع الأحداث المستقبلية أو تحديد السياسة الاقتصادية. استخدم \"الاقتصاد الرياضي\" للتعبير عن الأساليب الرياضية على مستوى تجريدي أكثر للنظريات الاقتصادية", language_id: (Language.find_by name: 'ar').id).id])
