Relationship.create([subject_id: (Resource.find_by literal: 'T0005672').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "A specific application of mathematical and statistical methods to the empirical measurement of economic relations and verification of economic theory, generally for the purpose of predicting future events or determining economic policy.  For the use of mathematical methods at a more abstract level of economic theory, use MATHEMATICAL ECONOMICS", language_id: (Language.find_by name: 'en').id).id])
