Relationship.create([subject_id: (Resource.find_by literal: 'T0005672').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Aplicación específica de métodos matemáticos y estadísticos en la medición empírica de las relaciones económicas y en la verificación de la teoría económica, generalmente con el propósito de predecir hechos futuros o de determinar una política económica. Para el empleo de métodos matemáticos a un nivel más abstracto de la teoría económica, úsese ECONOMIA MATEMATICA", language_id: (Language.find_by name: 'es').id).id])
